A key feature of Lambda Buffers is to provide both types and type class instances. Aiken has no support for type classes, so one must generate the type class system themselves. In other words, one must provide: A calling convention for functions with type classes. Functions to create instance dictionaries for instances of the type class. The former is straightforward to implement. One can explicit pass an instance dictionary for each function that requires a type class as per the usual compilation of type class code to type class free code. The latter requirement poses troubles for Aiken. Aiken does not allow one to create instance dictionaries (product types of the instance's methods) since composite types in Aiken cannot contain a function type. For example, the following Aiken type type EqDict<a> { eq: fn(a,a) -> Bool, neq: fn(a,a) -> Bool, } would produce an error as follows. $ aiken build Compiling me/package 0.0.0 (/aikentest/package) Compiling aiken-lang/stdlib 1.8.0 (/aikentest/package/build/packages/aiken-lang-stdlib) Error aiken::check::illegal::function_in_type × While trying to make sense of your code... ╰─▶ I found a type definition that has a function type in it. This is not allowed. ╭─[/aikentest/package/validators/myvalidator.ak:3:1] 3 │ type EqDict<a> { 4 │ eq: fn(a,a) -> Bool, · ─────────────────── 5 │ neq: fn(a,a) -> Bool, ╰──── help: Data-types can't hold functions. If you want to define method-like functions, group the type definition and the methods under a common namespace in a standalone module. Summary 1 error, 0 warnings This makes it impossible to pass instance dictionaries via Aiken's builtin types for type classes. Alternatively, one could try to sidestep Aiken's builtin types by creating a type which is a Church encoded tuple (i.e., implementing a tuple type via function types), but doing so requires higher ranked types which again Aiken does not support. Moreover, it appears that Aiken does not provide any "back doors" to the type system (e.g. TypeScript's any type) to trick the type system that using a Church encoded tuple and its projections are well typed. It's clear now that having an explicit type for an instance dictionary is not feasible in Aiken, so owing to the fact that an instance dictionary is a product type of functions, one can achieve type classes via dictionary passing by replacing all instance dictionaries as multiple arguments of each method in the type class, and replace the function to create an instance dictionary with multiple functions to create each method in the type class. This is indeed possible in Aiken, and to demonstrate this technique, consider the following Haskell code (which loosely models code generated from Lambda Buffers) class Eq a where eq :: a -> a -> Bool class PlutusData a where toData :: a -> Data fromData :: Data -> a data MyOption a = MyJust a | MyNothing instance Eq a => Eq (MyOption a) where eq (MyJust s) (MyJust t) = s == t eq MyNothing MyNothing = True eq _ _ = False instance PlutusData a => PlutusData (MyOption a) where toData (MyJust s) = Constr 0 [toData s] toData MyNothing = Constr 1 [] fromData (Constr 0 [s]) = MyJust (fromData s) fromData (Constr 1 []) = MyNothing fromData _ = error "bad parse" A translation to type class free code in Aiken is as follows. use aiken/builtin as builtin
use mypackage/lb_prelude/types_/int as lb_prelude_int // this would have to be implemented in an lb-prelude runtime pub type MyOption<t> { MyJust(t) MyNothing
} pub fn eq(eqt : fn(t,t) -> Bool) -> fn(MyOption<t>,MyOption<t>) -> Bool { fn(a,b) { when a is { MyJust(aJust) -> when b is { MyJust(bJust) -> eqt(aJust,bJust) MyNothing -> False } MyNothing -> when b is { MyJust(_) -> False MyNothing -> True } } }
} pub fn fromData(fromDataT : fn(Data) -> t) -> fn(Data) -> MyOption<t> { fn(theData) { let answer = builtin.choose_data (theData, (fn(theData) { let constr = builtin.un_constr_data(theData) let tag = constr.1st let fields = constr.2nd when tag is { 0 -> when fields is { [ justValue ] -> MyJust(fromDataT(justValue)) _ -> error @"Bad parse" } 1 -> when fields is { [] -> MyNothing _ -> error @"Bad parse" } _ -> error @"Bad parse" } })(theData), (fn(_theData) { error @"Bad parse" })(theData), (fn(_theData) { error @"Bad parse"})(theData), (fn(_theData){error @"Bad parse"})(theData), (fn(_theData) { error @"Bad parse"})(theData)) answer }
} pub fn toData(toDataT : fn(t) -> Data) -> fn(MyOption<t>) -> Data { fn(theOption) { when theOption is { MyJust(justValue) -> builtin.constr_data(0, [toDataT(justValue)]) MyNothing -> builtin.constr_data(1, []) } }
} // Example usages: test from_nothing_test() { fromData(lb_prelude_int.fromData)(builtin.constr_data(1, [])) == MyNothing
} test from_just_test() { fromData(lb_prelude_int.fromData)(builtin.constr_data(0, [builtin.i_data(69)])) == MyJust(69)
} test from_to_nothing_test() { toData(lb_prelude_int.toData)(fromData(lb_prelude_int.fromData)(builtin.constr_data(1, []))) == builtin.constr_data(1, [])
} test from_to_just_test() { toData(lb_prelude_int.toData)(fromData(lb_prelude_int.fromData)(builtin.constr_data(0, [builtin.i_data(69)]))) == builtin.constr_data(0, [builtin.i_data(69)])
} This translation of type classes has some limitations such as: All type class instances must be defined in the same module that the type is defined in i.e., orphan instances are forbidden. Only Haskell2010 type classes would be supported. While the above has demonstrated how one can translate type class instances in Lambda Buffers to type class free code in Aiken, this unfortunately leads to a bad user experience for the "builtin" PlutusData type class in Aiken. Aiken by default "generates" its own PlutusData instances for all composite types. As such, Aiken provides some nice syntactic features to make writing smart contracts particularly readable. A common pattern to write a validator in Aiken is as follows. pub type MyRecord<t> {a : t, b : Int } validator { pub fn hello_world(_redeemer: MyRecord<Int>, _scriptContext: Data) { // ^~~~ this will automatically use Aiken's builtin PlutusData instances ... }
} Unfortunately, with the type class system described in this section, an Aiken developer will no longer be able to write this (since Lambda Buffers would generate its own PlutusData instances that are not used by Aiken) and instead must write the validator more verbosely as follows. pub type MyRecord<t> {a : t, b : Int } validator { pub fn hello_world(redeemer: Data, _scriptContext: Data) { let actualRedeemer = myRecordFromData(intFromData)(redeemer) // ^~~~ Aiken users need to write more code in order to use Lambda // Buffers so that it will use Lambda Buffers' encoding for the // validator. Note that this sample assumes that `myRecordFromData :: (Data -> t) -> Data -> MyRecord<t>` // exists as would be generated by Lambda Buffers. ... }
} Clearly, this increase in code bloat to express the same simple idea contradicts the promises of making smart contracts easy to write on Aiken.

