All onchain scripts must be compiled to UPLC which must in some method represent the higher level language constructs like data types in the original language. Often, data types in a higher level language are translated to UPLC's builtin Data type which supports types like lists, constructors, integers, bytestrings, and maps. Note that data which will exist as a datum or redeemer must admit a representation with this Data type. Lambda Buffers chooses a particularly efficient encoding of its data types to Data mapping to its target languages that map to UPLC. For example, a record like record MyRecord = { a : Integer, b : Integer } would be translated to [a, b] i.e., records are lists of all record components [1] . There are some special cases for the encoding in Lambda Buffers. For example, singleton records are encoded as just the single element. If Lambda Buffers compiled MyRecord to a record in Aiken as follows. type MyRecord { a : Int, b : Int
} Then, one can observe that Aiken will internally represent this as the following Data type Constr 0 [a, b] where we note that Aiken includes a useless Constr 0 tag meaning Aiken's encoding is less efficient than Lambda Buffers' encoding. In general, Aiken's documentation for the encoding from Aiken's types to UPLC Data is unclear, but one can inspect the generated UPLC to verify that Aiken would encode the data as mentioned above. For example, given the following Aiken module pub type MyRecord { a: Int, b: Int } validator { pub fn hello_world(_redeemer: Data, _scriptContext: Data) { let theRecord = MyRecord(69, -69) theRecord.a == 420 && theRecord.b == -420 }
} One can compile and inspect the UPLC as follows $ aiken build --uplc
...
$ cat artifacts/myvalidator.hello_world.uplc
artifacts/myvalidator.hello_world.uplc
(program 1.0.0 [ (lam i_0 [ (lam i_1 [ (lam i_2 [ (lam i_3 (lam i_4 (lam i_5 (force [ [ [ i_3 (force [ [ [ i_3 [ [ (builtin equalsInteger) [ (builtin unIData) [ i_1 [ i_2 [ (builtin unConstrData) (con data (Constr 0 [I 69, I -69]) ) ] ] ] ] ] (con integer 420) ] ] (delay [ [ (builtin equalsInteger) [ (builtin unIData) [ i_1 [ i_0 [ i_2 [ (builtin unConstrData) (con data (Constr 0 [I 69, I -69]) ) ] ] ] ] ] ] (con integer -420) ] ) ] (delay (con bool False)) ] ) ] (delay (con unit ())) ] (delay [ (error ) (force (error )) ]) ] ) ) ) ) (force (builtin ifThenElse)) ] ) (force (force (builtin sndPair))) ] ) (force (builtin headList)) ] ) (force (builtin tailList)) ]
) In particular, the following lines are evidence to support that the record is encoded inefficiently as Constr 0 [<integer>, <integer>]. [ (builtin unConstrData) (con data (Constr 0 [I 69, I -69]) ) ] This is awkward for Lambda Buffers since when Aiken works with the MyRecord type, it is represented with the Constr tag meaning that Lambda Buffers' efficient encoding would be translated to Aiken's inefficient encoding. Ideally, one would want to change how Aiken encodes its data types internally so that Aiken can use Lambda Buffers' efficient encoding everywhere. Thus, we lose all benefits of Lambda Buffers' efficient encoding when working with Aiken's mechanisms to define types because Lambda Buffers is forced to take an extra step to translate to Aiken's inefficient encoding. As such, Aiken's opinionated way of encoding its data is at odds with Lambda Buffers. To resolve the mismatch in the encoding of data between the two, one could alternatively sidestep all of Aiken's methods for defining types and instead use Aiken's opaque types to alias Data and provide ones own constructors / record accesses as follows. use aiken/builtin as builtin pub opaque type MyRecord { data: Data } // Constructor for `MyRecord`
pub fn myRecord(a: Int, b: Int) -> MyRecord { MyRecord{ data : builtin.list_data([builtin.i_data(a), builtin.i_data(b)]) }
} // Projection for the field `a` of `MyRecord`
pub fn myRecord_a(value : MyRecord) -> Int { builtin.un_i_data(builtin.head_list(builtin.un_list_data(value)))
} // Projection for the field `b` of `MyRecord`
pub fn myRecord_b(value : MyRecord) -> Int { builtin.un_i_data(builtin.head_list(builtin.tail_list(builtin.un_list_data(value))))
} validator { pub fn hello_world(_redeemer: Data, _scriptContext: Data) { let theRecord = myRecord(69, -69) myRecord_a(theRecord) == 420 && myRecord_b(theRecord) == -420 }
} Interested readers may inspect the compiled UPLC to verify that the data encoding of MyRecord agrees with Lambda Buffers' encoding. (program 1.0.0 [ (lam i_0 [ (lam i_1 [ (lam i_2 [ (lam i_3 (lam i_4 (lam i_5 (force [ [ [ i_3 [ (lam i_6 (force [ [ [ i_3 [ [ (builtin equalsInteger) [ (builtin unIData) [ i_1 [ (builtin unListData) i_6 ] ] ] ] (con integer 420) ] ] (delay [ [ (builtin equalsInteger) [ (builtin unIData) [ i_1 [ i_0 [ (builtin unListData) i_6 ] ] ] ] ] (con integer -420) ] ) ] (delay (con bool False)) ] ) ) [ (builtin listData) [ [ i_2 (con data (I 69)) ] [ [ i_2 (con data (I -69)) ] (con (list data) []) ] ] ] ] ] (delay (con unit ())) ] (delay [ (error ) (force (error )) ]) ] ) ) ) ) (force (builtin ifThenElse)) ] ) (force (builtin mkCons)) ] ) (force (builtin headList)) ] ) (force (builtin tailList)) ]
) Note that this would most likely offer a poor user experience as this would essentially replace a large part of Aiken's language construct with our own generated functions for constructing, deconstructing, serialization / deserialization to Data, etc. In either case, to mediate the Data serialization / deserialization mismatch of Aiken and Lambda Buffers, it puts a bulkier mental overhead on the Aiken developer. For example, as in the previous section, an Aiken developer would expect to write a validator as follows. pub type MyRecord {a : Int, b : Int } validator { pub fn hello_world(_redeemer: MyRecord, _scriptContext: Data) { // ^~~~ this will automatically use Aiken's builtin Data serialization and deserialization ... }
