This chapter will walk through a translation from a LambdaBuffers' module into a Typescript module. To demonstrate this, we will use the lbf-prelude-to-typescript CLI tool which is just a convenient wrapper over the raw lbf CLI. To this end, we may enter a development shell which provides this tool along with many other Lambda Buffers CLI tools with the following command. $ nix develop github:mlabs-haskell/lambda-buffers#lb
$ lbf<tab>
lbf lbf-plutus-to-haskell lbf-plutus-to-rust lbf-prelude-to-haskell lbf-prelude-to-rust
lbf-list-modules-typescript lbf-plutus-to-purescript lbf-plutus-to-typescript lbf-prelude-to-purescript lbf-prelude-to-typescript Or, we may directly refer to the lbf-prelude-to-typescript CLI with the following command. nix run github:mlabs-haskell/lambda-buffers#lbf-prelude-to-typescript In this chapter, we will use the former option. Consider the Document.lbf schema which we may recall is as follows. module Document -- Importing types
import Prelude (Text, List, Set, Bytes) -- Author
sum Author = Ivan | Jovan | Savo -- Reviewer
sum Reviewer = Bob | Alice -- Document
record Document a = { author : Author, reviewers : Set Reviewer, content : Chapter a } -- Chapter
record Chapter a = { content : a, subChapters : List (Chapter a) } -- Some actual content
sum RichContent = Image Bytes | Gif Bytes | Text Text -- Rich document
prod RichDocument = (Document RichContent) We generate the corresponding Typescript code with the following commands. $ nix develop github:mlabs-haskell/lambda-buffers#lb
$ lbf-list-modules-typescript lbf-document=. > lb-pkgs.json $ lbf-prelude-to-typescript --gen-opt="--packages lb-pkgs.json" Document.lbf
$ find autogen/
autogen/
autogen/LambdaBuffers
autogen/LambdaBuffers/Document.mts
autogen/build.json The generated autogen directory created contains the generated Typescript modules. Note that lbf-list-modules-typescript is needed to create a JSON object which maps package names (for NPM) to Lambda Buffers' modules. Thus, in this example, one should have a package.json file which associates the key "name" with the string value "lbf-document". The autogen/build.json file can be ignored. The file autogen/LambdaBuffers/Document.mts contains the outputted Typescript module: // @ts-nocheck
import * as LambdaBuffers$Document from './Document.mjs'
import * as LambdaBuffers$Prelude from './Prelude.mjs' export type Author = | { name : 'Ivan' } | { name : 'Jovan' } | { name : 'Savo' }
export const Author : unique symbol = Symbol('Author')
export type Chapter<$a> = { content : $a , subChapters : LambdaBuffers$Prelude.List<Chapter<$a>> }
export const Chapter : unique symbol = Symbol('Chapter')
export type Document<$a> = { author : Author , reviewers : LambdaBuffers$Prelude.Set<Reviewer> , content : Chapter<$a> }
export const Document : unique symbol = Symbol('Document')
export type Reviewer = | { name : 'Bob' } | { name : 'Alice' }
export const Reviewer : unique symbol = Symbol('Reviewer')
export type RichContent = | { name : 'Image' , fields : LambdaBuffers$Prelude.Bytes } | { name : 'Gif' , fields : LambdaBuffers$Prelude.Bytes } | { name : 'Text' , fields : LambdaBuffers$Prelude.Text }
export const RichContent : unique symbol = Symbol('RichContent')
export type RichDocument = Document<RichContent>
export const RichDocument : unique symbol = Symbol('RichDocument')

