A type class in Typescript is an object type which defines a set of methods. For example, the Eq type class in Haskell defines the set of methods == (equality) and /= (inequality) as follows. class Eq a where (==) :: a -> a -> Bool (/=) :: a -> a -> Bool The corresponding Eq class in Typescript is: export interface Eq<A> { readonly eq: (l: Readonly<A>, r: Readonly<A>) => boolean; readonly neq: (l: Readonly<A>, r: Readonly<A>) => boolean;
} Each type class in Typescript must have an associated global variable which maps unique representations of its instance types to the corresponding object of the type class implementation. For example, the Eq type class has the global variable defined in the lbr-prelude library defined as follows export const Eq: EqInstances = { } as EqInstances where EqInstances is an interface type that is initially empty but will be extended with instances of types later. export interface EqInstances { } Finally, the following invariant is maintained in the code generator: Every type T has an associated unique symbol also called T. So, the type Integer has export type Integer = bigint
export const Integer: unique symbol = Symbol('Integer') and implementing its Eq instance amounts to the following code. export interface EqInstances { [Integer]: Eq<Integer>
}
Eq[Integer] = { eq: (l,r) => l === r , neq: (l,r) => l !== r } For types defined in the LambdaBuffers schema, this chunk of code will be automatically generated provided there is an appropriate derive construct.
